import React from 'react';
import PropTypes from 'prop-types';

//app
import { Layout } from 'components';
import { 
  ClaimsSelectPolicy,
  ClaimsUploadViewSearchDocs,   
  ClaimsUnderwritingGroups,
  ClaimsMovementType
} from 'modules';
import ClaimsFixedBottomBar from '../ClaimsFixedBottomBar/ClaimsFixedBottomBar';
import styles from './ClaimsPolicySearch.styles';
import * as constants from 'consts';

//mui
import { makeStyles, Grid, Box } from '@material-ui/core';

ClaimsPolicySearchView.propTypes = {
  isAllStepsCompleted: PropTypes.bool.isRequired,
  lastStep: PropTypes.bool.isRequired,
  handleCancel: PropTypes.func.isRequired,
  handleFinish: PropTypes.func.isRequired,
  handleNext: PropTypes.func.isRequired,
  handleBack: PropTypes.func.isRequired,
  handleNextSubmit: PropTypes.func,
  hasPolicyRef: PropTypes.bool.isRequired,
  policyInformation: PropTypes.object.isRequired,
  setCurrentContextActive: PropTypes.func,
  currentContextActive: PropTypes.bool,
};

export default function ClaimsPolicySearchView(props) {
  const {
    confirm,
    setConfirm,
    handleSearchNext,
    hasPolicyRef,
    policyInformation,
    currentContextActive,
    fields,
    underWritingGroups,
    hasClaimRef,
    uwResetKey,
    claimForm
  } = props;

  const classes = makeStyles(styles, { name: 'ClaimsPolicySearch' })();

  console.log("underWritingGroup ", underWritingGroups)

  return (
    <>
      <div className={classes.wrapper}>
        <Layout main padding>
          <Box>
            <Grid container>
              <Grid item xs={12}>
                <ClaimsSelectPolicy setConfirm={setConfirm} />
              </Grid>
              <Grid item xs={12} md={9}>
                  <ClaimsUnderwritingGroups fields={fields} claimForm={claimForm} uwResetKey={uwResetKey} hasClaimRef={hasClaimRef} />
                </Grid>
                <Grid item xs={12} md={3}>
                  <ClaimsMovementType
                    fields={fields}
                    claimForm={claimForm}
                    underWritingGroups={underWritingGroups}
                    enforceValueSet={true}
                  />
                </Grid>
              <Grid item xs={12}>
                {hasPolicyRef && currentContextActive && (
                  <ClaimsUploadViewSearchDocs
                    refData={{ ...policyInformation }}
                    refIdName={constants.DMS_CONTEXT_POLICY_ID}
                    dmsContext={constants.DMS_CONTEXT_POLICY}
                    viewOptions={{
                      upload: false,
                    }}
                    defaultTab={constants.DMS_VIEW_TAB_SEARCH}
                    documentTypeKey={constants.DMS_DOCUMENT_TYPE_SECTION_KEYS.type.claims}
                  />
                )}
              </Grid>
            </Grid>
          </Box>
        </Layout>
      </div>
      <ClaimsFixedBottomBar {...props} handleNextSubmit={handleSearchNext} next={confirm} save={confirm} />
    </>
  );
}
